pragma solidity ^0.8.10;

import "./interface/IFidoMeta.sol";


contract PrivateSale  {
    uint private immutable rate;
    address payable owner;
    IFidoMeta token;
    uint weiRaised;
    uint pancakeListingTime;

     event TokenPurchase(
        address indexed purchaser,
        address indexed beneficiary,
        uint256 value,
        uint256 amount
    );

    constructor(
        address token_,
        uint rate_,
        uint256 pancakeListingTime_
    ) 
    {
        require(rate_ > 0);
        require(token_ != address(0));
        require(pancakeListingTime_ > 0);

        owner = payable(msg.sender);
        token = IFidoMeta(token_);
        weiRaised = 0;
        rate = rate_;
        pancakeListingTime = pancakeListingTime_;
    }

    


    function buyToken(address _beneficiary) external payable {
        uint256 weiAmount = msg.value;
          // calculate token amount to be created
        uint256 _tokenAmount = _getTokenAmount(weiAmount);

        weiRaised += weiAmount;

        token.transfer(_beneficiary, _tokenAmount);
        owner.transfer(weiAmount);

        emit TokenPurchase(
            msg.sender,
            _beneficiary,
            weiAmount,
            _tokenAmount
        );

    }

    function _getTokenAmount(uint256 _weiAmount)
    internal view returns (uint256)
    {
        return _weiAmount*rate;
    }
}
